import React, { Component } from 'react'
import { Card, List, Typography } from 'antd'
import { connect } from 'react-redux';
import { Link } from 'react-router-dom'

const data = [
    'Racing car sprays burning .',
    'Japanese princess to .',
    'Australian walks 100km ',
    'Man charged over missing',
    'Los Angeles battles',
    'Man charged over missing',
];
class Left extends Component {
    render() {
        return (
            <div>
                <Card hoverable title="精品课程">
                    <List
                        size="small"
                        bordered
                        dataSource={this.props.list}
                        renderItem={item => <List.Item>
                            <Typography.Text ellipsis="true">

                                <Link to={`/detail/${item.get('_id')}`}>{item.get('title')}</Link>

                            </Typography.Text></List.Item>}>
                    </List>
                </Card>
            </div>
        )
    }
}
const mapStateToProps = (state) => ({
    list: state.get('home').get('curriculumlist')
})
export default connect(mapStateToProps, null)(Left);
